import React from 'react';

const Certificates = () => {
  return (
    <section id="certificates" className="section">
      <h2>Certificates</h2>
      <div className="certificate-box">
        <ul>
          <li>
            <a href="/images/Coursera%201RXUT7I73D50.pdf" target="_blank" rel="noopener noreferrer">
              Coursera Certificate 1
            </a>
          </li>
          <li>
            <a href="/images/CamScanner%2011-26-2024%2018.51.pdf" target="_blank" rel="noopener noreferrer">
              CamScanner Certificate
            </a>
          </li>
        </ul>
      </div>
    </section>
  );
};

export default Certificates;
